import React,{useState} from "react";


const Register =()=>{
    const [user,setUser] = useState({
        name:'',
        email:'',
        password:'',
        password2:''
    }) ;

    const {name,email,password,password2}= user;

    const onChange = e => setUser({...user , [e.target.name]:e.target.value});
    const onSubmit = e =>{
        e.preventDefault();
        console.log('Register Submit');
    };


    return(
        <div className='form-container'>
            <h1>
                Account <span className="text-primary">Register</span>
            </h1>

            <form onSubmit={onSubmit}>
                <div className="form-group">
                    <label htmlFor="name">Name</label>
                    <input type="text" onChange={onChange} value={name} name="name"/>
                </div>
                <div className="form-group">
                    <label htmlFor="email">Email Address</label>
                    <input type="email" onChange={onChange} value={email} name="email"/>
                </div>
                <div className="form-group">
                    <label htmlFor="password">Password</label>
                    <input type="password" onChange={onChange} value={password} name="password"/>
                </div>
                <div className="form-group">
                    <label htmlFor="password2">Confirm Password</label>
                    <input type="password" onChange={onChange} value={password2} name="password2"/>
                </div>

                <input type="submit" value="Register" className="btn btn-primary btn-block"/>

            </form>

        </div>
    );



};


export default Register;
